    [],nt"revision_timestamp": "2015-09-27T00:15:44.656088",nt"name": "hydrometeorological-automated-data-system",nt"isopen":
    false,nt"url": null,nt"notes": "The Office of Hydrologic Development of
    the National Weather Service operates HADS, the Hydrometeorological Automated Data
    System. This data set contains the last 48 hours worth of hydrometeorological measurements
    collected by Hydrometeorological Automated Data System. These basic measurements
    include air and water temperature, dew point temperature, river discharge, precipitation
    accumulator, actual increment precipitation, river/lake height, wind speed and direction,
    peak wind speed and direction, dissolved oxygen, ph, water turbidity, water velocity,
    water conductance, and salinity. The data set includes reports from many observing
    networks run by different providers.",nt"license_title": null,nt"extras":
